import React from 'react';
import { useNavigate } from 'react-router-dom';

function HomePage() {
  const navigate = useNavigate();

  return (
    <div
      className="flex flex-col items-center justify-center p-6 min-h-screen w-full h-full bg-cover bg-center bg-no-repeat"
      style={{
        backgroundImage: "url('https://tse4.mm.bing.net/th/id/OIP.w0EdljMyJAGtUw4E6SOBIwHaE8?pid=Api&P=0&h=180')",
        backgroundColor: 'rgba(255, 255, 255, 0.7)',
        backgroundBlendMode: 'lighten',
        minHeight: '100vh',
        minWidth: '100vw',
      }}
    >
      <h1 className="text-5xl font-extrabold text-blue-700 mb-8 text-center">
        Craft Your Perfect Resume Effortlessly
      </h1>
      <button
        onClick={() => navigate('/name')}
        className="px-6 py-3 bg-blue-600 text-white rounded-lg text-lg hover:bg-blue-700 transition"
      >
        View More
      </button>
    </div>
  );
}

export default HomePage;
